void Texture_evaluate_call(bContext *C, ReportList *reports, PointerRNA *_ptr, ParameterList *_parms)
{
	struct Tex *_self;
	float *value;
	float *result;
	char *_data;
	
	_self = (struct Tex *)_ptr->data;
	_data = (char *)_parms->data;
	value = ((float *)_data);
	_data += 12;
	result = ((float *)_data);
	
	texture_evaluate(_self, value, result);
}

